import React from "react";
import ReactDOM from 'react-dom'
import Header3 from "./header3";

function Header(){
    return(
      <div className='count'>
        <Header3/>
      </div>
    )
  }

function Header4(){
  return (
    <div className="topnav" >

    <h1>URL Shortener</h1>


          <div class="dropdown">
          <button class="btn">
        <svg width="180px" height="60px" viewBox="0 0 180 60" class="border">
          <polyline points="179,1 179,59 1,59 1,1 179,1" class="bg-line" />
          <polyline points="179,1 179,59 1,59 1,1 179,1" class="hl-line" />
        </svg>
        <span>Reports</span>
      </button>
  <div class="dropdown-content" >
  <a href="/home/view">
              <button class="btn btn-outline-primary" type="button">List Of URL's Shortened</button>
              </a>
              <a href="/user/users">
              <button class="btn btn-outline-primary" type="button">List Of Users</button>
              </a>
  </div>

  <div class="dropdown">
<a href="/user/login">
          <button class="btn btn-outline-primary" type="button"> Logout</button>
          </a>
</div>
</div>

</div>
  )
}

  document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
        <Header4/>,
        document.getElementById('header4')
      )
      })

  document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
      <Header/>,
      document.getElementById('header3')
    )
    })
